import React from 'react';
import { Typography, Container, Grid, Box, Paper, Button, Chip } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
  const skills = [
    'Java', 'C#', 'C++', 'Python', 'Golang', 'JavaScript', 'TypeScript',
    'ReactJS', 'Node.js', 'REST APIs', 'HTML', 'CSS',
    'Java (Spring Boot)', 'Kafka', 'Redis', 'Microservices',
    'Azure', 'CI/CD', 'Docker (basic)',
    'MySQL', 'MongoDB', 'NoSQL', 'SQL',
    'Data Structures & Algorithms', 'Object-Oriented Programming', 'System Design (basic)',
    'VS Code', 'Git', 'Linux', 'Postman', 'MATLAB', 'Windows'
  ];

  const SkillChip = ({ skill }) => (
    <Chip
      label={skill}
      size="small"
      sx={{
        m: 1,
        borderRadius: '4px',
        transition: 'transform 0.2s',
        '&:hover': {
          transform: 'scale(1.05)',
        },
      }}
    />
  );

  return (
    <Container maxWidth="lg" sx={{ mt: 12, mb: 4 }}>
      {/* Name and Introduction Section */}
      <Box sx={{ textAlign: 'center', mb: 8 }}>
        <Typography 
          variant="h2" 
          component="h1" 
          gutterBottom
          sx={{ 
            fontWeight: 'bold',
            fontSize: '4rem',
            color: '#1976d2',
            textShadow: '2px 2px 4px rgba(0,0,0,0.1)'
          }}
        >
          Anish Jain
        </Typography>
        <Typography variant="h5" color="text.secondary" paragraph>
          Backend Engineer | AI | Java Developer
        </Typography>
        <Typography variant="body1" paragraph>
          Experienced Backend Engineer with a strong foundation in Java, Spring Boot, and cloud technologies.
          Skilled in building scalable microservices and high-performance distributed systems.
          Passionate about crafting efficient, reliable software and continuously exploring emerging tech.
        </Typography>
      </Box>

      {/* Get in Touch Button */}
      <Box sx={{ mb: 8 }}>
        <Button
          component={Link}
          to="/contact"
          variant="contained"
          color="primary"
          size="large"
          sx={{
            width: '50%',
            mx: 'auto',
            display: 'block'
          }}
        >
          Get in Touch
        </Button>
      </Box>

      {/* Skills Section */}
      <Paper sx={{ p: 4, mb: 8 }}>
        <Typography variant="h4" gutterBottom>
          Skills
        </Typography>
        <Box sx={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center' }}>
          {skills.map((skill) => (
            <SkillChip key={skill} skill={skill} />
          ))}
        </Box>
      </Paper>

      {/* Certifications Section */}
      <Paper sx={{ p: 4 }}>
        <Typography variant="h4" gutterBottom>
          Certifications
        </Typography>
        <ul>
          <li>React Developer Certification</li>
          <li>JavaScript Essentials</li>
          <li>Full Stack Development</li>
        </ul>
      </Paper>
      {/* Footer */}
      <Box sx={{ mt: 8, textAlign: 'center' }}>
        <Typography variant="body2" color="text.secondary">
          Made using Windsurf AI
        </Typography>
      </Box>
    </Container>
  );
};

export default Home;
